import getData from './getData'



export async function getStaticProps(context) {
  const miStats = await getData("https://api.covidtracking.com/v1/states/mi/current.json");
  const usStats = await getData("https://api.covidtracking.com/v1/us/current.json");

return {
  props: {
    miStats,
    usStats,
  }
}

}

function Index(props) {
  return (
    <>
      <section>
        <h1> Current Michigan Data</h1>
        <h2>Data Quality Grade: {props.miStats.dataQualityGrade}</h2>
        <h2>
          Data last updated: {props.miStats.date}
        </h2>
        <h2>Currently hospitalized: {props.miStats.hospitalizedCurrently} </h2>
        <h2>Currently in ICU: {props.miStats.inIcuCurrently}</h2>
        <h2>Deaths: {props.miStats.death}</h2>
        <h2>Recovered: {props.miStats.recovered}</h2>
      </section>
      <section>
        <h1> Current US Data</h1>
        <h2>
          Data last updated: {props.usStats}
        </h2>
        <h2>Currently hospitalized: {} </h2>
        <h2>Currently in ICU: {}</h2>
        <h2>Deaths: {}</h2>
        <h2>Recovered: {}</h2>
      </section>
    </>
  );
}

export default Index;
